properties.script:
try {
    var fhirVersion = $('fhirVersion');
    var type = $('fhirType').toLowerCase();
    var requestMethod = $('method');
    var requestUri = $('uri');
    var requestUrl = $('url');
//    if (! requestUrl.endsWith('/')) {
//        requestUrl += '/';
//    }
    var requestUrl = new java.net.URI(requestUrl);

//    Added to get the last segment of path if ID was provided, commented it out since fhirId variable can be used 
//    channelMap.put('path', requestUrl.getPath());
//    var pathlist = requestUrl.getPath().split("/");
//    var pathid;
//    for (var i = 0; i < pathlist.length; i++) {
//       if (pathlist[i] == type && pathlist[i+1]) {
//            pathid = pathlist[i+1];
//        }
//    }
    var fhirId = $('fhirId');

    // Add more supported parameters as you see fit
    var supportedParameters =[
    // All resources
    '_id',
    '_lastupdated']
//    '_text']

    // Add more supported parameters as you see fit
    var supportedTypeParameters = {
        organization:[
                'identifier',
                'name',
                'address-city',
                'address-postalcode',
                'address-state',
                'address-country',
                'service-type',
                'service-category',
                'funding',
                'qualification',
                'language',
                'program'
        ],
        location:[
                'identifier',
                'name',
                'address-city',
                'address-postalcode',
                'address-state',
                'address-country',
                'service-type',
                'service-category',
                'funding',
                'qualification',
                'language',
                'program',
                'accessibility',
                'hoursofoperation'
        ],
        healthcareservice:[
                'identifier',
                'name',
                'address-city',
                'address-postalcode',
                'address-state',
                'address-country',
                'service-type',
                'service-category',
                'funding',
                'qualification',
                'language',
                'program',
                'accessibility',
                'availabletime'
         ]
    }

    if (type) {
        var typeParameters = supportedTypeParameters[type];
        if (typeParameters) {
            for each (param in typeParameters) {
                supportedParameters.push(param);
            }
        }
    }

    // Uncomment this to reject requests with parameters that aren't supported
    for each (key in $('parameters').getKeys().toArray()) {
        if (supportedParameters.indexOf(key +'') < 0) {   // Removed ignorecase since parameters are treated case sensitive in the search below. 
            return createOperationOutcome('error', 'invalid', 'Unknown or unsupported parameter ' + key + '.', fhirVersion);
        }
    }

//    var _text = $('parameters').getParameter('_text');

    var _id = $('parameters').getParameter('_id');

    var _lastUpdated = $('parameters').getParameter('_lastUpdated');
    var lastUpdatedOperator = 'eq';
    if (_lastUpdated) {
        try {
            if (/^(eq|ne|gt|lt|ge|le|sa|eb|ap).*/.test(_lastUpdated)) {
                lastUpdatedOperator = _lastUpdated.substr(0, 2);
                _lastUpdated = _lastUpdated.substr(2);
            }
            _lastUpdated = convertDate(_lastUpdated, 'yyyy-MM-dd HH:mm:ss.SSSZZ');
        }
        catch (e) {
            return createOperationOutcome('error', 'invalid', 'Parameter _lastUpdated formatted incorrectly: ' + _lastUpdated, fhirVersion,e);
        }
    }

    var _count = $('parameters').getParameter('_count');
    if (_count) {
        _count = parseInt(_count, 10);
        if (! _count) {
            return createOperationOutcome('error', 'invalid', 'Parameter _count formatted incorrectly: ' + $('parameters').getParameter('_count'), fhirVersion);
        }
    }

    // Build up the WHERE clause and prepared query parameters
    var whereParts =[];
    var params =[];

    // Search on the entire content of the resource
//    if (_text) {
//        whereParts.push(getFhirSearchContentWherePart());
//        params.push('%' + _text + '%');
//    }


    // When the resource version last changed
    if (_lastUpdated) {
        whereParts.push('last_updated_date ' + getFhirSearchLastUpdatedWherePart(lastUpdatedOperator));
        params.push(_lastUpdated);
    }

    // Add resource-specific query expressions
    if (type == 'organization') {
        if (fhirId) {
            whereParts.push('org.id = ');
            params.push(fhirId);
        }
        if (_id) {
            whereParts.push('org.id = ');
            params.push(_id);
        }
        if ($('parameters').contains('identifier')) {
            whereParts.push('org.tax_id ilike ');
            params.push('%' + $('parameters').getParameter('identifier') + '%');
        }
        if ($('parameters').contains('name')) {
            whereParts.push('org.name ilike ');
            params.push('%' + $('parameters').getParameter('name') + '%');
        }
    } else if (type == 'location') {
        if (fhirId) {
            whereParts.push('loc.id = ');
            params.push(fhirId);
        }
        if (_id) {
            whereParts.push('loc.id = ');
            params.push(_id);
        }
        if ($('parameters').contains('name')) {
            whereParts.push('loc.name ilike ');
            params.push('%' + $('parameters').getParameter('name') + '%');
        }
        if ($('parameters').contains('accessibility')) {
            whereParts.push('locacc.accessibility ilike ');
            params.push('%' + $('parameters').getParameter('accessibility') + '%');
        }
        if ($('parameters').contains('hoursofoperation')) {
            whereParts.push('schedulebyday ilike ');
            params.push('%' + $('parameters').getParameter('hoursofoperation') + '%');
        }
    } else if (type == 'healthcareservice') {
        if (fhirId) {
            whereParts.push('svc.id = ');
            params.push(fhirId);
        }
        if (_id) {
            whereParts.push('svc.id = ');
            params.push(_id);
        }
        if ($('parameters').contains('name')) {
            whereParts.push('svc.name ilike ');
            params.push('%' + $('parameters').getParameter('name') + '%');
        }
        if ($('parameters').contains('availabletime')) {
            whereParts.push('schedulebyday ilike ');
            params.push('%' + $('parameters').getParameter('availabletime') + '%');
        }
    } else if (type != 'capabilitystatement') {
        return createOperationOutcome('error', 'transient', 'resource type not supported', type, 500);
    }

    if (type == 'organization' || type == 'location' || type == 'healthcareservice') {
        if ($('parameters').contains('address-city')) {
            whereParts.push('city ilike ');
            params.push('%' + $('parameters').getParameter('address-city') + '%');
        }
        if ($('parameters').contains('address-postalcode')) {
            whereParts.push('postal_code ilike ');
            params.push('%' + $('parameters').getParameter('address-postalcode') + '%');
        }
        if ($('parameters').contains('address-state')) {
            whereParts.push('state_province ilike ');
            params.push('%' + $('parameters').getParameter('address-state') + '%');
        }
        if ($('parameters').contains('address-country')) {
            whereParts.push('country ilike ');
            params.push('%' + $('parameters').getParameter('address-country') + '%');
        }
        if ($('parameters').contains('service-type')) {
            whereParts.push('service_type_desc ilike ');
            params.push('%' + $('parameters').getParameter('service-type') + '%');
        }
        if ($('parameters').contains('service-category')) {
            whereParts.push('service_category_desc ilike ');
            params.push('%' + $('parameters').getParameter('service-category') + '%');
        }
        if ($('parameters').contains('qualification')) {
            whereParts.push('accreditations ilike ');
            params.push('%' + $('parameters').getParameter('qualification') + '%');
        }
        if ($('parameters').contains('funding')) {
            whereParts.push('funding_sources ilike ');
            params.push('%' + $('parameters').getParameter('funding') + '%');
        }
        if ($('parameters').contains('language')) {
            whereParts.push('languages ilike ');
            params.push('%' + $('parameters').getParameter('language') + '%');
        }
        if ($('parameters').contains('program')) {
            whereParts.push('programs ilike ');
            params.push('%' + $('parameters').getParameter('program') + '%');
        }
    }

    var whereClause = '';
    if (whereParts.length > 0) {
        whereClause = ' WHERE ';

        for (var i = 0; i < whereParts.length; i++) {
            whereClause += whereParts[i] + ' \'' + params[i] + '\'';
            if (i < whereParts.length - 1) {
                whereClause += ' AND ';
            }
        }
    }

    //var querySelect = 'select * from organization';
    //var querySelect = 'SELECT id, name, alternate_name, description, email, url, tax_status, tax_id, year_incorporated, legal_status FROM organization'
    //var querySelect = 'select json_agg(organization) from organization'; // expected only one record if json string
    //var queryCriteria = ' where name like \'%' + nameCriteria + '%\'';
    var bundle = new Packages.org.hl7.fhir.r4.model.Bundle().setType(Packages.org.hl7.fhir.r4.model.Bundle.BundleType.SEARCHSET);
    var link = new Packages.org.hl7.fhir.r4.model.Bundle.BundleLinkComponent;
    link.relation = 'self';
    link.url = requestUrl.resolve(requestUri);
    bundle.addLink(link); 
    var orgids = '';
    var locids = '';

    if(type == 'capabilitystatement') {
        var fullUrl = requestUrl.toString().toLowerCase();
        if (! fullUrl.endsWith('/')) {
            fullUrl += '/';
        }
        var resData = CapabilityStatement_Resource_Builder(fullUrl);
        channelMap.put('capresource',JSON.stringify(resData));

        var resource = FhirUtil.fromJSON(JSON.stringify(resData), fhirVersion);
        var response = FhirResponseFactory.getHistoryResponse(FhirUtil.toXML(resource, fhirVersion), 200, FhirUtil.getMIMETypeXML());
        responseMap.put('response', response);
        return response.getMessage();
    } else {
        //Build query and FHIR bundle entries for the resource type being queried
        var query = Hsds_Query_Builder(type, whereClause);
        Hsds2Fhir_Bundle_Builder(type, query, bundle);

        channelMap.put('orgids', orgids);
        channelMap.put('locids', locids);
        channelMap.put('fhirBundle', FhirUtil.toJSON(bundle,fhirVersion));

        //If type is not organization, then add organization resource entries to the bundle
        if ((type == 'location' || type == 'healthcareservice') && (orgids != '')) {
            var query = Hsds_Query_Builder('organization', 'WHERE org.id in (' + orgids + ')');
            Hsds2Fhir_Bundle_Builder('organization', query, bundle);
        }

        if (type == 'healthcareservice' && locids != '') {
            var query = Hsds_Query_Builder('location', 'WHERE loc.id in (' + locids + ')');
            Hsds2Fhir_Bundle_Builder('location', query, bundle);
        }

        bundle.setTotal(bundle.getEntry().size());;
        var response = FhirResponseFactory.getHistoryResponse(FhirUtil.toXML(bundle, fhirVersion), 200, FhirUtil.getMIMETypeXML());
        responseMap.put('response', response);
        return response.getMessage();
    }
}
catch (e) {
    return createOperationOutcome('error', 'transient', 'Error fetching resources.', fhirVersion, 500, e);
};

function Hsds_Query_Builder(qrytype, whereClause) {
    if (qrytype == 'organization') {
        query = 'select row_to_json(temp) from \
                (  \
                     select distinct org.*, coalesce(md.last_action_date,now()) as last_updated_date,  \
                            (select jsonb_agg(row_to_json(orgph)) from  \
                                ( \
                                    select ph.id, ph.organization_id, ph.type, ph.number  \
                                    from phone ph  \
                                    where ph.organization_id = org.id  \
                                ) as orgph \
                            ) as phones, \
                            (select jsonb_agg(row_to_json(orgadrs)) from  \
                                ( \
                                    select pa.id, loc.organization_id, pa.location_id, pa.address_1, pa.address_2, pa.city, pa.region,  \
                                           pa.state_province, pa.postal_code, pa.country, loc.latitude, loc.longitude \
                                    from location loc  \
                                    join physical_address pa on pa.location_id = loc.id  \
                                    where loc.organization_id = org.id  \
                                    union  \
                                    select ma.id, loc.organization_id, ma.location_id, ma.address_1, ma.address_2, ma.city, ma.region,  \
                                           ma.state_province, ma.postal_code, ma.country, loc.latitude, loc.longitude \
                                    from location loc  \
                                    join postal_address ma on ma.location_id = loc.id  \
                                    where loc.organization_id = org.id                                              \
                                ) as orgadrs \
                            ) as addresses, \
                            (select jsonb_agg(row_to_json(orgcontact)) from  \
                                ( \
                                    select ct.id, ct.organization_id, ct.name, ct.title, ct.department, ct.email, ctph.phone_number \
                                    from contact ct \
                                    left join  \
                                    ( \
                                        select ph1.contact_id, ph1.number as phone_number \
                                         from phone ph1 \
                                         left join phone ph2 on ph2.organization_id = ph1.organization_id and ph2.type = ph1.type and ph2.id < ph1.id \
                                         where ph1.type = \'voice\' and ph2.id is null  \
                                    ) as ctph on ctph.contact_id = ct.id     \
                                    where ct.organization_id = org.id  \
                                ) as orgcontact \
                            ) as contacts, \
                            programs,  \
                            orgacr.accreditations,  \
                            languages,  \
                            funding_sources                      \
                    from organization org \
                    left join service svc            on svc.organization_id = org.id  \
                    left join location loc           on loc.organization_id = org.id  \
                    left join physical_address pa    on pa.location_id = loc.id  \
                    left join  \
                    (select resource_id, max(last_action_date) as last_action_date  \
                         from metadata  \
                         group by resource_id  \
                    ) as md on org.id = md.resource_id  \
                    left join  \
                    (select pg.organization_id, STRING_AGG(pg.name, \', \') as programs  \
                        from program pg  \
                        group by pg.organization_id  \
                    ) orgpg on orgpg.organization_id = org.id  \
                    left join  \
                    (select svcacr.organization_id, STRING_AGG(svcacr.accreditations, \', \') as accreditations  \
                        from service svcacr  \
                        group by svcacr.organization_id  \
                    ) orgacr on orgacr.organization_id = org.id  \
                    left join  \
                    (select loclang.location_id, STRING_AGG(loclang.language, \', \') as languages  \
                        from language loclang  \
                        group by loclang.location_id  \
                    ) lang on lang.location_id = loc.id  \
                    left join  \
                    (select orgfnd.organization_id, STRING_AGG(orgfnd.source, \', \') as funding_sources  \
                         from funding orgfnd  \
                         group by orgfnd.organization_id  \
                    ) as fnd on fnd.organization_id = org.id  \
                    left join \
                    (select sat.service_id, STRING_AGG(tt.term, \', \') as service_type, STRING_AGG(tt.description, \', \') as service_type_desc \
                        from service_attribute sat  \
                        join taxonomy_term tt       on tt.id = sat.taxonomy_term_id \
                        group by sat.service_id \
                    ) satype on satype.service_id = svc.id \
                    left join \
                    (select sac.service_id, STRING_AGG(ttc.term, \', \') as service_category, STRING_AGG(ttc.description, \', \') as service_category_desc \
                        from service_attribute sac \
                        join taxonomy_term tt       on tt.id = sac.taxonomy_term_id \
                        join taxonomy_term ttc      on ttc.id = tt.parent_id \
                        group by sac.service_id \
                    ) sacat on sacat.service_id = svc.id \
                '
    } else if (qrytype == 'location') {
        query = 'select row_to_json(temp) from \
                    ( \
                    select distinct loc.*, coalesce(md.last_action_date,now()) as last_updated_date,  accessibility, org.name as organization_name, \
                            (select jsonb_agg(row_to_json(locph)) from  \
                                ( \
                                    select ph.id, ph.organization_id, ph.type, ph.number  \
                                    from phone ph  \
                                    where ph.organization_id = org.id  \
                                ) as locph \
                            ) as phones, \
                            (select jsonb_agg(row_to_json(locadrs)) from  \
                                ( \
                                    select pa.id, pa.address_1, pa.address_2, pa.city, pa.region,  \
                                           pa.state_province, pa.postal_code, pa.country \
                                    from physical_address pa   \
                                    where pa.location_id = loc.id  \
                                ) as locadrs \
                            ) as addresses, \
                            (select jsonb_agg(row_to_json(loccontact)) from  \
                                ( \
                                    select ct.id,  ct.name, ct.title, ct.department, ct.email, ctph.phone_number \
                                    from contact ct \
                                    join service_at_location sal on ct.service_at_location_id = sal.location_id \
                                    left join  \
                                    ( \
                                        select ph1.contact_id, ph1.number as phone_number \
                                        from phone ph1 \
                                        left join phone ph2 on ph2.contact_id = ph1.contact_id and ph2.type = ph1.type and ph2.id < ph1.id \
                                        where ph1.type = \'voice\' and ph2.id is null  \
                                    ) as ctph on ctph.contact_id = ct.id     \
                                    where sal.location_id = loc.id  \
                                ) as loccontact \
                            ) as contacts, \
                            (select jsonb_agg(row_to_json(locsch)) from  \
                                ( \
                                    select distinct sc.location_id, sc.byday, sc.opens_at, sc.closes_at, sc.description \
                                    from schedule sc   \
                                    where sc.location_id = loc.id  \
                                ) as locsch \
                            ) as schedule, \
                            programs,  \
                            locacr.accreditations,  \
                            languages,  \
                            funding_sources \
                    from location loc \
                    join organization org            on loc.organization_id = org.id \
                    left join service_at_location sl on loc.id = sl.location_id  \
                    left join service svc            on sl.service_id = svc.id \
                    left join physical_address pa    on pa.location_id = loc.id \
                    left join \
                    (select resource_id, max(last_action_date) as last_action_date \
                        from metadata \
                        group by resource_id \
                    ) as md on md.resource_id = loc.id                 \
                    left join  \
                    (select salpg.location_id, string_agg(pg.name, \', \') as programs  \
                        from service svcpg \
                        join service_at_location salpg on salpg.service_id = svcpg.id \
                        join program pg                on svcpg.program_id = pg.id  \
                        group by salpg.location_id \
                    ) locpg on locpg.location_id = loc.id  \
                    left join \
                    (select salcr.location_id, STRING_AGG(svcacr.accreditations, \', \') as accreditations \
                        from service svcacr \
                        join service_at_location salcr on salcr.service_id = svcacr.id \
                        group by salcr.location_id \
                    ) locacr on locacr.location_id = loc.id \
                    left join \
                    (select loclang.location_id, STRING_AGG(loclang.language, \', \') as languages \
                        from language loclang \
                        group by loclang.location_id \
                    ) lang on lang.location_id = loc.id \
                    left join  \
                    (select orgfnd.organization_id, STRING_AGG(orgfnd.source, \', \') as funding_sources  \
                        from funding orgfnd  \
                        group by orgfnd.organization_id  \
                    ) as fnd on fnd.organization_id = org.id  \
                    left join  \
                    (select location_id, STRING_AGG(accessibility, \', \') as accessibility \
                        from accessibility_for_disabilities acc \
                        group by acc.location_id \
                    ) locacc on locacc.location_id = loc.id \
                    left join \
                    (select sat.service_id, STRING_AGG(tt.term, \', \') as service_type, STRING_AGG(tt.description, \', \') as service_type_desc \
                        from service_attribute sat  \
                        join taxonomy_term tt       on tt.id = sat.taxonomy_term_id \
                        group by sat.service_id \
                    ) satype on satype.service_id = svc.id \
                    left join \
                    (select sac.service_id, STRING_AGG(ttc.term, \', \') as service_category, STRING_AGG(ttc.description, \', \') as service_category_desc \
                        from service_attribute sac \
                        join taxonomy_term tt       on tt.id = sac.taxonomy_term_id \
                        join taxonomy_term ttc      on ttc.id = tt.parent_id \
                        group by sac.service_id \
                    ) sacat on sacat.service_id = svc.id \
                    left join \
                    (select location_id, STRING_AGG(sc.byday, \', \') as schedulebyday \
                        from schedule sc   \
                        group by location_id  \
                    ) as sch on sch.location_id = loc.id  \
                '    
    } else if (qrytype == 'healthcareservice') {
        query = 'select row_to_json(temp) from \
                    ( \
                     select distinct svc.*, coalesce(md.last_action_date,now()) as last_updated_date, org.name as organization_name,  \
                            CASE svc.status WHEN \'active\' then \'true\' ELSE \'false\' END AS active_status,  \
                            (select jsonb_agg(row_to_json(svcloc)) from  \
                                ( \
                                    select loc.id, loc.name  \
                                    from location loc  \
                                    join service_at_location sal on sal.location_id = loc.id \
                                    where sal.service_id = svc.id  \
                                ) as svcloc \
                            ) as locations, \
                            (select jsonb_agg(row_to_json(svcph)) from  \
                                ( \
                                    select ph.id, ph.organization_id, ph.type, ph.number  \
                                    from phone ph  \
                                    where ph.service_id = svc.id  \
                                ) as svcph \
                            ) as phones, \
                            (select jsonb_agg(row_to_json(svcsch)) from  \
                                ( \
                                    select distinct sc.service_id,  sc.byday, sc.opens_at, sc.closes_at, sc.description \
                                    from schedule sc  \
                                    where sc.service_id = svc.id \
                                ) as svcsch \
                            ) as schedule, \
                            programs,  \
                            accreditations,  \
                            languages,  \
                            funding_sources,  \
                            accessibility, \
                            service_areas, \
                            service_loc_desc, \
                            service_type, \
                            service_type_desc, \
                            service_category, \
                            service_category_desc \
                    from service svc \
                    join organization org            on svc.organization_id = org.id \
                    left join service_at_location sl on svc.id = sl.service_id  \
                    left join physical_address pa    on sl.location_id = pa.location_id \
                    left join \
                    (select resource_id, max(last_action_date) as last_action_date \
                         from metadata \
                         group by resource_id \
                    ) as md on md.resource_id = svc.id                 \
                    left join \
                    (select pg.id as program_id, STRING_AGG(pg.name, \', \') as programs \
                        from program pg \
                        group by pg.id \
                    ) svcpg on svcpg.program_id = svc.program_id \
                    left join \
                    (select svclang.service_id, STRING_AGG(svclang.language, \', \') as languages \
                        from language svclang \
                        group by svclang.service_id \
                    ) lang on lang.service_id = svc.id \
                    left join  \
                    (select svcfnd.service_id, STRING_AGG(svcfnd.source, \', \') as funding_sources  \
                        from funding svcfnd  \
                        group by svcfnd.service_id  \
                    ) as fnd on fnd.service_id = svc.id  \
                    left join  \
                    (select sal.service_id, STRING_AGG(accessibility, \', \') as accessibility \
                        from accessibility_for_disabilities acc \
                        join service_at_location sal  on sal.location_id = acc.location_id \
                        group by sal.service_id \
                    ) locacc on locacc.service_id = svc.id \
                    left join \
                    (select sarea.service_id, STRING_AGG(sarea.service_area, \', \') as service_areas  \
                        from service_area sarea \
                        group by sarea.service_id \
                    ) area on area.service_id = svc.id \
                    left join \
                    (select sldsc.service_id, STRING_AGG(sldsc.Description, \', \') as service_loc_desc \
                        from service_at_location sldsc  \
                        group by sldsc.service_id \
                    ) svcdsc on svcdsc.service_id = svc.id \
                    left join \
                    (select sat.service_id, STRING_AGG(tt.term, \', \') as service_type, STRING_AGG(tt.description, \', \') as service_type_desc \
                        from service_attribute sat  \
                        join taxonomy_term tt       on tt.id = sat.taxonomy_term_id \
                        group by sat.service_id \
                    ) satype on satype.service_id = svc.id \
                    left join \
                    (select sac.service_id, STRING_AGG(ttc.term, \', \') as service_category, STRING_AGG(ttc.description, \', \') as service_category_desc \
                        from service_attribute sac \
                        join taxonomy_term tt       on tt.id = sac.taxonomy_term_id \
                        join taxonomy_term ttc      on ttc.id = tt.parent_id \
                        group by sac.service_id \
                    ) sacat on sacat.service_id = svc.id \
                    left join \
                    (select service_id, STRING_AGG(sc.byday, \', \') as schedulebyday \
                        from schedule sc   \
                        group by service_id  \
                    ) as sch on sch.service_id = svc.id  \
                '        
    } else {
        return createOperationOutcome('error', 'transient', 'resource type not supported', qrytype, 500);
    }

    query += whereClause + ') as temp order by id';
    channelMap.put('query' + qrytype, query);
    return query;
}

function Hsds2Fhir_Bundle_Builder(entrytype, query, bundle) {
    var dbFacade = DatabaseConnectionFactory.createDatabaseConnection($('facadeDBDriver'), $('facadeDBUrl'), $('facadeDBUsername'), $('facadeDBPassword'));
    try {
        var result = dbFacade.executeCachedQuery(query);

        while (result.next()) {
            var resultHsdsString = result.getString(1);
            channelMap.put('resultHsds', JSON.stringify(resultHsdsString));            

            var resData = Hsds2Fhir_Record_Transformer(entrytype, JSON.parse(resultHsdsString));
            channelMap.put('resultFhir', JSON.stringify(resData));
            var resType = resData.resourceType;
            var resId = resData.id;
            var resVersion = 1;

            var entry = bundle.addEntry();
            // As per the FHIR Validator: Bundle: bdl-3: 'entry.request mandatory for batch/transaction/history, otherwise prohibited' - removed since this is search set bundle
            //var request = new Packages.org.hl7.fhir.r4.model.Bundle.BundleEntryRequestComponent().setMethod(new Packages.org.hl7.fhir.r4.model.Bundle.HTTPVerbEnumFactory().fromCode(requestMethod)).setUrl(requestUrl);
            //entry.setRequest(request);

            // As per the FHIR Validator: Bundle.entry[0]: bdl-8: 'fullUrl cannot be a version specific reference' Rule 'fullUrl cannot be a version specific reference
            var fullUrl = requestUrl.toString().toLowerCase();
            fullUrl = fullUrl.replace(type, entrytype); // replace entry type for other resources 
            fullUrl = fullUrl.replace(fhirId, ""); // remove fhirID if that was specified in the path
            if (! fullUrl.endsWith('/')) {
                fullUrl += '/';
            }
            entry.setFullUrl(fullUrl + resId);
            // + '/_history/' + resVersion).toString());
            //channelMap.put('entry.resource', FhirUtil.fromJSON(JSON.stringify(resData), fhirVersion));

            entry.setResource(FhirUtil.fromJSON(JSON.stringify(resData), fhirVersion));

            var search = new Packages.org.hl7.fhir.r4.model.Bundle.BundleEntrySearchComponent;
            search.setMode(Packages.org.hl7.fhir.r4.model.Bundle.SearchEntryMode.MATCH);
            //search.setScore(1.0);  // throws error on type mismatch for double
            entry.setSearch(search);
        }
    }
    finally {
        if (dbFacade) {
            dbFacade.close();
        }
    }
}

function Hsds2Fhir_Record_Transformer(entrytype, msg) {
    if (entrytype == 'organization') {
        return Hsds2Fhir_Organization_Record_Transformer(msg);
    } else if (entrytype == 'location') {
        return Hsds2Fhir_Location_Record_Transformer(msg);
    } else if (entrytype == 'healthcareservice') {
        return Hsds2Fhir_Service_Record_Transformer(msg);
    } else {
        return createOperationOutcome('error', 'transient', 'resource type not supported', entrytype, 500);
    }
}

function Hsds2Fhir_Convert_Phone_Type(phonetype) {
    var contactpointsystem;

    switch(phonetype){
        case 'text': contactpointsystem = 'sms'; break;
        case 'fax': contactpointsystem = 'fax'; break;
        case 'cell': contactpointsystem = 'phone'; break;
        case 'video': contactpointsystem = 'other'; break;
        case 'pager': contactpointsystem = 'pager'; break;
        case 'textphone': contactpointsystem = 'sms'; break;
        case 'voice': contactpointsystem = 'phone'; break;
        default: contactpointsystem = 'phone'; break;
    }
    return contactpointsystem; 
}

function Hsds2Fhir_Convert_DayOfWeek(byday) {
    var DaysOfWeek = Lists.list();

    if(byday.toLowerCase().includes('mon')){DaysOfWeek.add('mon')};
    if(byday.toLowerCase().includes('tue')){DaysOfWeek.add('tue')};
    if(byday.toLowerCase().includes('wed')){DaysOfWeek.add('wed')};
    if(byday.toLowerCase().includes('thu')){DaysOfWeek.add('thu')};
    if(byday.toLowerCase().includes('fri')){DaysOfWeek.add('fri')};
    if(byday.toLowerCase().includes('sat')){DaysOfWeek.add('sat')};
    if(byday.toLowerCase().includes('sun')){DaysOfWeek.add('sun')};

    DaysOfWeek = DaysOfWeek.toArray();
    return DaysOfWeek; 
}

function Hsds2Fhir_Organization_Record_Transformer(msg) {

    var OrgTelecoms = Lists.list();
    for (var i = 0; i < getArrayOrXmlLength(msg.phones);i++) {
        (msg.phones[i].number) && OrgTelecoms.add({
              id:newStringOrUndefined(msg.phones[i].id),
            system: newStringOrUndefined(Hsds2Fhir_Convert_Phone_Type(msg.phones[i].type)),
            value: newStringOrUndefined(msg.phones[i].number),
            use: newStringOrUndefined('work')
        });
    };
    (msg.email) && OrgTelecoms.add({
        system: newStringOrUndefined('email'),
        value: newStringOrUndefined(msg.email),
        use: newStringOrUndefined('work')
    });
    (msg.url) && OrgTelecoms.add({
        system: newStringOrUndefined('url'),
        value: newStringOrUndefined(msg.url),
        use: newStringOrUndefined('work')
    });
    OrgTelecoms = OrgTelecoms.toArray();

    var OrgAddresses = Lists.list();
    for (var i = 0; i < getArrayOrXmlLength(msg.addresses);
    i++) {
        (msg.addresses[i].location_id) && OrgAddresses.add({
              id: newStringOrUndefined(msg.addresses[i].id),
            use: newStringOrUndefined('work'),
            type: newStringOrUndefined(msg.addresses[i].type),
            text: newStringOrUndefined(msg.addresses[i].address_1 + ', ' + msg.addresses[i].address_2 + ',' + msg.addresses[i].city + ', ' +
                                       msg.addresses[i].state_province + '-' + msg.addresses[i].postal_code + ' ' + msg.addresses[i].country),
            line:[
                newStringOrUndefined(msg.addresses[i].address_1),
                newStringOrUndefined(msg.addresses[i].address_2)
            ],
            city: newStringOrUndefined(msg.addresses[i].city),
            district: newStringOrUndefined(msg.addresses[i].region),
            state: newStringOrUndefined(msg.addresses[i].state_province),
            postalCode: newStringOrUndefined(msg.addresses[i].postal_code),
            country: newStringOrUndefined(msg.addresses[i].country),
            extension: [{
                url: newStringOrUndefined('http://hl7.org/fhir/StructureDefinition/geolocation'),
                extension: [{
                    url: newStringOrUndefined('latitude'),
                    valueDecimal:newStringOrUndefined(msg.addresses[i].latitude)
                },
                {
                    url: newStringOrUndefined('longitude'),
                    valueDecimal:newStringOrUndefined(msg.addresses[i].longitude)
                }]
            }] 
        });
    };
    OrgAddresses = OrgAddresses.toArray();

    var OrgContacts = Lists.list();
    for (var i = 0; i < getArrayOrXmlLength(msg.contacts);i++) {
        (msg.contacts[i].name) && OrgContacts.add({
            id: newStringOrUndefined(msg.contacts[i].id),
            name: newStringOrUndefined(msg.contacts[i].name),
            extension: (msg.contacts[i].department) &&[ {
                //id: newStringOrUndefined('department'), // Removed id since it throws duplicate errors when there are multiple contact departments
                url: newStringOrUndefined('http://hl7.org/fhir/us/FHIR-IG-Human-Services-Directory/StructureDefinition/contact-department'),
                valueString: newStringOrUndefined(msg.contacts[i].department)
            }],
            telecom:[
            (msg.contacts[i].phone_number) && {
                system: newStringOrUndefined('phone'),
                value: newStringOrUndefined(msg.contacts[i].phone_number),
                use: newStringOrUndefined('work')
            },
            (msg.contacts[i].email) && {
                system: newStringOrUndefined('email'),
                value: newStringOrUndefined(msg.contacts[i].email),
                use: newStringOrUndefined('work')
            }]
        });
    };
    OrgContacts = OrgContacts.toArray();

    var tmp = {
        resourceType: newStringOrUndefined('Organization'),
        id: newStringOrUndefined(msg.id),
        meta: {
            lastUpdated: newStringOrUndefined(msg.last_updated_date),
            profile: [
                "http://hl7.org/fhir/us/davinci-pdex-plan-net/StructureDefinition/plannet-Organization",
                "http://hl7.org/fhir/us/StructureDefinition/hsds-Organization"
            ]
        },
        // text data element is for the resource description with th HTML markup tag so not used for organization description
        //            text: (newStringOrUndefined(msg.description)) && {
        //                status: newStringOrUndefined('generated'),
        //                div: newStringOrUndefined(msg.description)
        //            },
        //{
        //        url: newStringOrUndefined('code'),
        //        valueCodeableConcept: (msg.tax_status) && {
        //            text: newStringOrUndefined(msg.tax_status)
        //        }
        //    },
        //    {
        //        url: newStringOrUndefined('code'),
        //        valueCodeableConcept: (msg.legal_status) && {
        //            text: newStringOrUndefined(msg.legal_status)
        //        }
        //    }
        extension:[{
            id: newStringOrUndefined('qualification'),
            url: newStringOrUndefined('http://hl7.org/fhir/us/davinci-pdex-plan-net/StructureDefinition/qualification'),
            extension: [{
                url: newStringOrUndefined('code'),
                valueCodeableConcept: {
                    text: newStringOrUndefined(msg.accreditations)
                }
            },
            {
                url: newStringOrUndefined('status'),
                valueCode: (msg.accreditations) && newStringOrUndefined('active')
            }]
        },
        {
            id: newStringOrUndefined('org-description'),
            url: newStringOrUndefined('http://hl7.org/fhir/us/davinci-pdex-plan-net/StructureDefinition/org-description'),
            valueString: (msg.description) && newStringOrUndefined(msg.description)
        }],
        identifier:[(msg.tax_id) && {
            id: newStringOrUndefined(msg.id),
            use: newStringOrUndefined('official'),
            type: {
                coding:[{
                    system: newStringOrUndefined('http://terminology.hl7.org/CodeSystem/v2-0203'),
                    code: newStringOrUndefined('TAX'),
                    display: newStringOrUndefined('Tax ID Number')
                }],
                systems: newStringOrUndefined('urn:us:gov:irs:'),
                text: newStringOrUndefined('TAX')
            },
            value: newStringOrUndefined(msg.tax_id),
            period: {
                start: newStringOrUndefined(msg.year_incorporated)
            }
        }],
        active: newBooleanOrUndefined(true),
        type:[{
            coding:[{
                system: newStringOrUndefined('http://hl7.org/fhir/us/davinci-pdex-plan-net/CodeSystem/OrgTypeCS'),
                code: newStringOrUndefined('atyprv'),
                display: newStringOrUndefined('Atypical Provider')
            }]
        }],
        name: newStringOrUndefined(msg.name),
        alias:[
            newStringOrUndefined(msg.alternate_name)
        ],
        telecom: OrgTelecoms,
        address: OrgAddresses,
        contact: OrgContacts
    };

    return tmp;
}

function Hsds2Fhir_Location_Record_Transformer(msg) {

    // Build organizaiton id list for adding those resources in the bundle later
    if (orgids != '') {
        orgids += ', '
    };
    orgids +=  '\'' + msg.organization_id + '\'';

    var LocTelecoms = Lists.list();
    for (var i = 0; i < getArrayOrXmlLength(msg.phones);i++) {
        (msg.phones[i].number) && LocTelecoms.add({
              id:newStringOrUndefined(msg.phones[i].id),
            system: newStringOrUndefined(Hsds2Fhir_Convert_Phone_Type(msg.phones[i].type)),
            value: newStringOrUndefined(msg.phones[i].number),
            use: newStringOrUndefined('work')
        });
    };
    (msg.email) && LocTelecoms.add({
        system: newStringOrUndefined('email'),
        value: newStringOrUndefined(msg.email),
        use: newStringOrUndefined('work')
    });
    LocTelecoms = LocTelecoms.toArray();

    var LocSchedule = Lists.list();
    for (var i = 0; i < getArrayOrXmlLength(msg.schedule);i++) {
        (msg.schedule[i].byday || msg.schedule[i].opens_at || msg.schedule[i].closes_at) && LocSchedule.add({
            id: (msg.schedule[i].location_id) && newStringOrUndefined(msg.schedule[i].location_id),
            daysOfWeek: (msg.schedule[i].byday) && Hsds2Fhir_Convert_DayOfWeek(msg.schedule[i].byday),
            openingTime: (msg.schedule[i].opens_at) && newStringOrUndefined(msg.schedule[i].opens_at),
            closingTime: (msg.schedule[i].closes_at) &&newStringOrUndefined(msg.schedule[i].closes_at)
        });
    };
    LocSchedule = LocSchedule.toArray();

    var tmp = {
        resourceType: newStringOrUndefined('Location'),
        id: newStringOrUndefined(msg.id),
        meta: {
            lastUpdated: newStringOrUndefined(msg.last_updated_date),
            profile: [
                "http://hl7.org/fhir/us/davinci-pdex-plan-net/StructureDefinition/plannet-Location",
                "http://hl7.org/fhir/us/StructureDefinition/hsds-Location"
            ]
        },
        extension:[ {
            id: newStringOrUndefined('accessbility'),
            url: newStringOrUndefined('http://hl7.org/fhir/us/davinci-pdex-plan-net/StructureDefinition/accessibility'),
            valueCodeableConcept: (msg.accessibility) && {
                coding: {
                    system: newStringOrUndefined('http://hl7.org/fhir/us/davinci-pdex-plan-net/CodeSystem/AccessibilityCS'),
                    code: newStringOrUndefined('adacomp'),
                    display: newStringOrUndefined('ADA compliant')
                },
                text: newStringOrUndefined(msg.accessibility)
            }
        }, 
        {
            id: newStringOrUndefined('accessibility'),
            url: newStringOrUndefined('http://hl7.org/fhir/us/davinci-pdex-plan-net/StructureDefinition/accessibility'),
            valueCodeableConcept: (msg.transportation) && {
                coding: {
                    system: newStringOrUndefined('http://hl7.org/fhir/us/davinci-pdex-plan-net/CodeSystem/AccessibilityCS'),
                    code: newStringOrUndefined('pubtrans'),
                    display: newStringOrUndefined('public transit options')
                },
                text: newStringOrUndefined(msg.transportation)
            }
        }],
        status: newStringOrUndefined('active'),
        name: newStringOrUndefined(msg.name),
        alias:[
            newStringOrUndefined(msg.alternate_name)
        ],
        description: newStringOrUndefined(msg.description),
        telecom: LocTelecoms, 

        address:(msg.addresses) && {
            id: newStringOrUndefined(msg.addresses[0].id),
            use: newStringOrUndefined('work'),
            type: newStringOrUndefined(msg.addresses[0].type),
            text: newStringOrUndefined(msg.addresses[0].address_1 + ', ' + msg.addresses[0].address_2 + ',' + msg.addresses[0].city + ', ' +
                                       msg.addresses[0].state_province + '-' + msg.addresses[0].postal_code + ' ' + msg.addresses[0].country),
            line:[
                newStringOrUndefined(msg.addresses[0].address_1),
                newStringOrUndefined(msg.addresses[0].address_2)
            ],
            city: newStringOrUndefined(msg.addresses[0].city),
            district: newStringOrUndefined(msg.addresses[0].region),
            state: newStringOrUndefined(msg.addresses[0].state_province),
            postalCode: newStringOrUndefined(msg.addresses[0].postal_code),
            country: newStringOrUndefined(msg.addresses[0].country)
        },

        position: ((msg.longitude) && (msg.latitude)) && {
            longitude: newNumberOrUndefined(msg.longitude),
            latitude: newNumberOrUndefined(msg.latitude)
        },
        managingOrganization: {
            reference: newStringOrUndefined('plannet-Organization/' + msg.organization_id),
            type: newStringOrUndefined('Organization'),
            display: newStringOrUndefined(msg.organization_name)
        },
        hoursOfOperation: LocSchedule
    }

    return tmp;
}


function Hsds2Fhir_Service_Record_Transformer(msg) {

    // Build organizaiton id list for adding those resources in the bundle later
    if (orgids != '') {
        orgids += ', '
    };
    orgids +=  '\'' + msg.organization_id + '\'';

    var SvcLocations = Lists.list();
    for (var i = 0; i < getArrayOrXmlLength(msg.locations);i++) {
        (msg.locations[i].id) && SvcLocations.add({
            reference: newStringOrUndefined('plannet-Location/' + msg.locations[i].id),
            type: newStringOrUndefined('Location'),
            display: newStringOrUndefined(msg.locations[i].name)
        });

        // Build location id list for adding those resources in the bundle later
        if (locids != '') {
            locids += ', '
        };
        locids +=  '\'' + msg.locations[i].id + '\'';
    };

    SvcLocations = SvcLocations.toArray();

    var SvcTelecoms = Lists.list();
    for (var i = 0; i < getArrayOrXmlLength(msg.phones);i++) {
        (msg.phones[i].number) && SvcTelecoms.add({
              id:newStringOrUndefined(msg.phones[i].id),
            system: newStringOrUndefined(Hsds2Fhir_Convert_Phone_Type(msg.phones[i].type)),
            value: newStringOrUndefined(msg.phones[i].number),
            use: newStringOrUndefined('work')
        });
    };
    (msg.email) && SvcTelecoms.add({
        system: newStringOrUndefined('email'),
        value: newStringOrUndefined(msg.email),
        use: newStringOrUndefined('work')
    });
    (msg.url) && SvcTelecoms.add({
        system: newStringOrUndefined('url'),
        value: newStringOrUndefined(msg.url),
        use: newStringOrUndefined('work')
    });
    SvcTelecoms = SvcTelecoms.toArray();

    var SvcSchedule = Lists.list();
    for (var i = 0; i < getArrayOrXmlLength(msg.schedule);i++) {
        (msg.schedule[i].byday || msg.schedule[i].opens_at || msg.schedule[i].closes_at) && SvcSchedule.add({
            id: (msg.schedule[i].location_id) && newStringOrUndefined(msg.schedule[i].location_id),
            extension:(msg.schedule[i].description) && [ {
                url: newStringOrUndefined('http://hl7.org/fhir/us/davinci-pdex-plan-net/StructureDefinition/availabletime'),
                valueString: newStringOrUndefined(msg.schedule[i].description)
            } ], 
            daysOfWeek: (msg.schedule[i].byday) && Hsds2Fhir_Convert_DayOfWeek(msg.schedule[i].byday),
            availableStartTime: (msg.schedule[i].opens_at) && newStringOrUndefined(msg.schedule[i].opens_at),
            availableEndTime: (msg.schedule[i].closes_at) &&newStringOrUndefined(msg.schedule[i].closes_at)
        });
    };
    SvcSchedule = SvcSchedule.toArray();

    var tmp = {
        resourceType: newStringOrUndefined('HealthcareService'),
        id: newStringOrUndefined(msg.id),
        meta: {
            lastUpdated: newStringOrUndefined(msg.last_updated_date),
            profile: [
                "http://hl7.org/fhir/us/davinci-pdex-plan-net/StructureDefinition/plannet-HealthcareService",
                "http://hl7.org/fhir/us/StructureDefinition/hsds-HealthcareService"
            ]
        },
        active: newStringOrUndefined(msg.active_status),
        providedBy: {
            reference: newStringOrUndefined('plannet-Organization/' + msg.organization_id),
            type: newStringOrUndefined('Organization'),
            display: newStringOrUndefined(msg.organization_name)
        },
        // This information needs to be mapped
        category: (msg.service_category) && {
            coding: [{
                    system: newStringOrUndefined('http://hl7.org/fhir/us/FHIR-IG-Human-Services-Directory/CodeSystem/HumanSocialServiceCategoryCS'),
                    code: newStringOrUndefined(msg.service_category),
                    display: newStringOrUndefined(msg.service_category_desc)
            }],
            text: newStringOrUndefined(msg.service_category_desc)
        },
        type: [(msg.service_type) && {
            coding: [{
                    system: newStringOrUndefined('http://hl7.org/fhir/us/FHIR-IG-Human-Services-Directory/CodeSystem/HumanSocialServiceTypeCS'),
                    code: newStringOrUndefined(msg.service_type),
                    display: newStringOrUndefined(msg.service_type_desc)
            }],
            text: newStringOrUndefined(msg.service_type_desc)
        }],
        specialty: [{
            coding: [{
                    system: newStringOrUndefined('http://nucc.org/provider-taxonomy'),
                    code: newStringOrUndefined('104100000X'),
                    display: newStringOrUndefined('Social Worker')
            }],
            text: newStringOrUndefined('Social Worker')
        }],
        location:SvcLocations,
        name: newStringOrUndefined(msg.name),
        comment: (msg.service_loc_desc) && newStringOrUndefined(msg.service_loc_desc),
        extraDetails: (msg.funding_sources) && newStringOrUndefined('Funding Source: ' + msg.funding_sources),
        telecom: SvcTelecoms,
        coverageArea: (msg.service_areas) &&[ {
            display: newStringOrUndefined(msg.service_areas)
        }],
        program: (msg.programs) &&[ {
            text: newStringOrUndefined(msg.programs)
        }],
        characteristic: (msg.interpretation_services) &&[ {
            text: newStringOrUndefined(msg.interpretation_services)
        }],
        communication: (msg.languages) && [ {
            text: newStringOrUndefined(msg.languages)
        }],
        availableTime: SvcSchedule
    }

    return tmp;
}

