/**
	Sets the resource ID, version ID, and last updated date/time.

	@param {IBaseResource} resource - The FHIR resource object.
	@param {String} id - The logical ID of the resource.
	@param {Number} versionId - The version ID of the resource.
	@return {Date} The last updated date/time.
*/
function updateResourceMeta(resource, id, versionId) {
	resource.setId(id);
	resource.getMeta().setVersionId(new String(versionId));
	var lastUpdated = new java.util.Date();
	resource.getMeta().getLastUpdatedElement().setTimeZone(java.util.TimeZone.getDefault());
	resource.getMeta().setLastUpdated(lastUpdated);
	return lastUpdated;
}

/**
	calculates checksum
*/
function checksumCalc(str) 
	{
	var checksum = 3; // Add 3 for <ETX>

	toCalc = str.replace("\x02","");

	for (var i = 0; i < toCalc.length; i++) 
		checksum += toCalc[i].charCodeAt(0);

	var out = checksum % 256;

	out = out.toString(16);

	if (out.length == 1)
		out = "0" + out;

	return out.toUpperCase();
	};

/**
	Get all blood product adminstrations from caseXML
*/
// one function per template is recommended. i.e.) create a new code template for each new function.
function mdxn_GetBloodProducts(case_msg) {
  var blood_product_administrations = [];
  var admin_element = case_msg['case']['case-info']['blood-product-administrations'];
  var admin_length = admin_element['blood-product-administration'].length();

  for(var i=0;i<admin_length;i++)
  {
    var drug_name = admin_element['blood-product-administration'][i]['blood-product']['sysid'].toString();
    var drug_label = admin_element['blood-product-administration'][i]['blood-product']['sys-label'].toString();
    var drug_units = admin_element['blood-product-administration'][i]['blood-product']['unit'].toString();
    var chart_values_length = admin_element['blood-product-administration'][i]['chart-values']['chart-value'].length();

    for(var j=0;j<chart_values_length;j++)
    {
    	 var blood_product_admin = {};
    	 blood_product_admin.name = drug_name;
    	 blood_product_admin.label = drug_label;
      blood_product_admin.units = drug_units;
      blood_product_admin.time = admin_element['blood-product-administration'][i]['chart-values']['chart-value'][j]['time'].toString();
      blood_product_admin.dose = admin_element['blood-product-administration'][i]['chart-values']['chart-value'][j]['value'].toString();
      blood_product_administrations.push(blood_product_admin);
    }

  }
  return blood_product_administrations; 
}

/**
	Get a Ci item object by sysID from caseXML
*/
// one function per template is recommended. i.e.) create a new code template for each new function.
function mdxn_GetCaseItem(case_msg, sysid) { 
  for each(node in case_msg.descendants()) {
    if(node['@sysid'].toString() == sysid) {
    	 ret_obj = {};
    	 ret_obj.sysid = node['@sysid'].toString();
    	 ret_obj.syslabel = node['@sys-label'].toString();
    	 ret_obj.surgical_procedure = node['@surgical-procedure'].toString();
    	 ret_obj.value = node['value'].toString();
    	 ret_obj.parent_sysid = node.parent()['@sysid'];
    	 ret_obj.parent_syslabel = node.parent()['@sys-label'];
    	 ret_obj.grand_parent_sysid = node.parent().parent()['@sysid'];
    	 ret_obj.grand_parent_syslabel = node.parent().parent()['@sys-label'];
    	 return ret_obj;
    }
  }
}

