/**
	Get all drug adminstrations from caseXML
*/
// modify function_name and parameters as you wish.
// one function per template is recommended. i.e.) create a new code template for each new function.
function mdxn_GetDrugs(case_msg) {
  var drug_administrations = [];
  var admin_element = case_msg['case']['case-info']['drug-administrations']
  var admin_length = admin_element['drug-administration'].length();

  for(var i=0;i<admin_length;i++)
  {
    var drug_name = admin_element['drug-administration'][i]['drug']['rx-norms']['rx-norm']['name'].toString();
    var drug_units = admin_element['drug-administration'][i]['drug']['unit'].toString();
    // are we looking at an infusion or bolus drug admin
    if(admin_element['drug-administration'][i]['administrations']['administration']['flow-rates'].length() > 0) 
    {
      var flow_rate_length = admin_element['drug-administration'][i]['administrations']['administration']['flow-rates']['flow-rate'].length();
      for(var j=0;j<flow_rate_length;j++) {
	   var drug_admin = {};
	   drug_admin.type = 'infusion';
	   drug_admin.drug_name = drug_name;
	   drug_admin.units = drug_units;
	   drug_admin.dose = admin_element['drug-administration'][i]['administrations']['administration']['flow-rates']['flow-rate'][j]['rate'].toString();
	   drug_admin.time = admin_element['drug-administration'][i]['administrations']['administration']['flow-rates']['flow-rate'][j]['time'].toString();
	   drug_administrations.push(drug_admin);
      }
    }
    else if(admin_element['drug-administration'][i]['administrations']['administration']['dose'].length() > 0) 
    {        
	 var drug_admin = {};
	 drug_admin.type = 'bolus';
	 drug_admin.drug_name = drug_name;
	 drug_admin.units = drug_units;
	 drug_admin.dose = admin_element['drug-administration'][i]['administrations']['administration']['dose']['value'].toString();
	 drug_admin.time = admin_element['drug-administration'][i]['administrations']['administration']['dose']['dosed-at'].toString();
	 drug_administrations.push(drug_admin);
    }
  }
   return drug_administrations;
}

/**
	Get all fluids from caseXML
*/
// one function per template is recommended. i.e.) create a new code template for each new function.
function mdxn_GetFluids(case_msg) {
  var fluids_out = [];
  var fluids_element = case_msg['case']['case-info']['fluids-out'];
  var fluid_length = fluids_element['fluid-out'].length();

  for(var i=0;i<fluid_length;i++)
  {
    var fluid_out_element = fluids_element['fluid-out'][i];
    var fluid_name = fluid_out_element['fluid']['recorded-value-type']['sysid'].toString();;
    var fluid_label = fluid_out_element['fluid']['recorded-value-type']['sys-label'].toString();;
    var fluid_units = fluid_out_element['fluid']['recorded-value-type']['unit'].toString();;
    var recorded_values_length = fluid_out_element['recorded-values']['recorded-value'].length();

    for(var j=0;j<recorded_values_length;j++)
    {
    	 var fluid_out = {};
      fluid_out.name = fluid_name;
      fluid_out.label = fluid_label;
      fluid_out.units = fluid_units;
      fluid_out.time = fluid_out_element['recorded-values']['recorded-value'][j]['recorded-at'].toString();
      fluid_out.value = fluid_out_element['recorded-values']['recorded-value'][j]['value'].toString();
    	 fluids_out.push(fluid_out);
    }   	
  }
  return fluids_out;
}

/**
	Get an Hx item object by sysID from caseXML
*/
// one function per template is recommended. i.e.) create a new code template for each new function.
function mdxn_GetMedicalHistoryItem(case_msg, sysid) { 
  for each(node in case_msg.descendants()) {
    if(node['@sysid'].toString() == sysid) {
    	 ret_obj = {};
    	 ret_obj.sysid = node['@sysid'].toString();
    	 ret_obj.syslabel = node['@sys-label'].toString();
    	 ret_obj.value = node['value'].toString();
    	 ret_obj.parent_sysid = node.parent()['@sysid'];
    	 ret_obj.parent_syslabel = node.parent()['@sys-label'];
    	 ret_obj.grand_parent_sysid = node.parent().parent()['@sysid'];
    	 ret_obj.grand_parent_syslabel = node.parent().parent()['@sys-label'];
    	 return ret_obj;
    }
  }
}

