/**
	Get all *chart* recorded vitals from caseXML - note: does not include Ci or Hx vitals, use
	appropriate functions for those
*/
// one function per template is recommended. i.e.) create a new code template for each new function.
function mdxn_GetVitals(case_msg) {
  var vitals = [];
  var vital_element = case_msg['case']['case-info']['vitals'];
  var pulses_length = vital_element['pulses']['pulse'].length();
  var blood_pressures_length = vital_element['blood-pressures']['blood-pressure'].length();

  for(var i=0;i<pulses_length;i++)
  {
    var vital_obj = {};
    pulse_element = vital_element['pulses']['pulse'][i];
    vital_obj.type = 'pulse';
    vital_obj.value = pulse_element['recorded-value']['value'].toString();
    vital_obj.time = pulse_element['recorded-value']['recorded-at'].toString();
    vitals.push(vital_obj);
  }

  for(var j=0;j<blood_pressures_length;j++)
  {
    bp_element = vital_element['blood-pressures']['blood-pressure'][j];
    var bp_types = ['systolic', 'diastolic'];
    var vital_obj = {};
    vital_obj.type = 'blood pressure';

    for(var k=0;k<bp_types.length;k++)
    {
     vital_obj[bp_types[k] + "_value"] = bp_element[bp_types[k]]['recorded-value']['value'].toString();
     vital_obj.time = bp_element[bp_types[k]]['recorded-value']['recorded-at'].toString();
    }
    vitals.push(vital_obj);
  }
  return vitals; 
}

/**
	(string) returns string with common HTML entities escaped
*/
// modify function_name and parameters as you wish.
// one function per template is recommended. i.e.) create a new code template for each new function.
function mdxn_HTMLEscape(s) {
  s += '';
  return s.replace(/&/g, "&amp;").replace(/"/g, "&quot;").replace(/'/g, "&#39;").replace(/>/g, "&gt;").replace(/</g, "&lt;");
}

/**
	(filename, string) appends timestamped logstring to filename
*/
// one function per template is recommended. i.e.) create a new code template for each new function.

function mdxn_log(filename, logstring) {
  var logfile = java.io.File(filename);
  var append = true;
  var ts = (new Date()).toISOString();
  org.apache.commons.io.FileUtils.writeStringToFile(logfile, ts + ": " + logstring + "\n", append);
}

/**
	(logfile, host, token, xmlstring, case_number) Posts xmlstring via curl and logs result
*/
// modify function_name and parameters as you wish.
// one function per template is recommended. i.e.) create a new code template for each new function.

function mdxn_POSTToScheduleAPI(logfile, api_host, api_token, xmlstring, case_number) {

  var cmd = [];
  cmd[0] = 'curl';
  cmd[1] = '-u';
  cmd[2] = 'X:' + api_token;
  cmd[3] = '-H';
  cmd[4] = 'Content-Type: application/xml';
  cmd[5] = '-d';
  cmd[6] = xmlstring;
  cmd[7] = 'https://' + api_host + '/schedule_api/v2/cases.xml';
  cmd[8] = '-w';
  cmd[9] = '%{http_code}';

  var outstr = '';
  var logmsg = '';
  try {
    var proc = java.lang.Runtime.getRuntime().exec(cmd);
    var curlIn = java.io.DataInputStream(proc.getInputStream());
    var xmldoc = '';
    while ((outstr = curlIn.readLine()) != null) {
      if ((outstr.toString().trim() + '') === '000') {
        logmsg = "Network Error, perhaps host is down?";
        mdxn_log(logfile, logmsg + " Tried sending data: " + xmlstring);
        throw errmsg
      }
      xmldoc += outstr;  // collect XML response from server
    }

    var res = new XML(xmldoc);

    var code = '';
    if (res.status) {
      code = res.status.toString().trim();
    }
    if (code === '') {
      // treat response as literal string if not an xml status document
      code = xmldoc.trim();
    }

    switch(code) {
    case '200':
    case '201':
      logmsg = 'api code ' + code + " - case number '" + case_number + "', OK";
      break;
    case '422':
      logmsg = "api code 422 - case number '" + case_number + "' could not be updated due to its status: " + res.error;
      break;
    case '404':
      logmsg = "api code 404 - case number '" + case_number + "' could not be found";
      break;
    default:
      logmsg = "api code " + code + ": error '" + res.error + "', got literal response: '" + xmldoc;
    }
    mdxn_log(logfile, logmsg);

  } catch (err) {
    mdxn_log(logfile, "failure with " + api_host + ", reason: " + err);
  }
}

/**
	(string) returns string Proper Cased
*/
// modify function_name and parameters as you wish.
// one function per template is recommended. i.e.) create a new code template for each new function.
function mdxn_ProperCase(s) {
  s = s.toString() + "";
  return s.toLowerCase().replace(/^(.)|\s(.)/g,
      function($1) { return $1.toUpperCase(); });
}
